import React from 'react';
import { View,  StyleSheet} from 'react-native';




export function Home({ navigation }) {
  return (
    <View style={styles.container}>

    </View>
  );
}


const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'top',
  },
  header: {
    width: '100%',
    flexDirection: 'row',
    alignItems: 'center',
    justifyContent: 'center',
    paddingHorizontal: 15,
    paddingBottom: 10,
    paddingTop: 10,
  },
  heading: {
    fontSize: 24,
  },
  image: {
    ...getWindowDimensions(),
  },
});
